window.bookSummaryJSON = "<p>Iris Johansen's beloved forensic sculptor, Eve Duncan, is back, and now the stakes are higher than ever. </p> <p>Dramatic changes are on the horizon for Eve and Joe Quinn, and their relationship may never be the same. Faced with the task of protecting Cara Delaney, a young girl with ruthless enemies who want to see her dead, Eve takes her away to the remote Scottish Highlands, where they join Jane MacGuire in search of a hidden treasure. But nowhere is far enough away to protect Cara from danger. </p> <p>With enemies closing in from all sides, <i>Hide Away</i> is a high-octane thriller that fans will not want to miss. </p>"; 
